import { useState, useEffect } from "react";
import{ makeStyles } from "@material-ui/core/styles";
import mokData from './mokData';
import axiox from 'axios';
import{AppBar, Toolbar, Grid, Card, CardContent, CircularProgress, CardMedia, Typography} from "@material-ui/core";


const useStyles = makeStyles({
    dataContainer: {
        paddingTop:"20px",
        paddingLeft:"50px",
        paddingRight:"50px"    
    },
    cardMedia:{
        margin:'auto',
    },
    cardContent:{
        textAlign:'center',
    },
});


const displayData=()=>{
    return(
        <Grid item xs={12} sm={4}>
            <Card>
                <CardContent>test</CardContent>
            </Card>
        </Grid>
    )

}


const Content = () => {
    const classes= useStyles();
    const [myData, setMyData]= useState(undefined)

    return ( 
        <div>
            {myData ? (
            <Grid container spacing={2} className={classes.dataContainer}>
                {displayData()}
                {displayData()}
                {displayData()}
                {displayData()}

            </Grid>
            ):(
                <CircularProgress className="center"/>
            )}

        </div>
     );
}

export default Content;
